classdef SpaceGroupInfo
    % SpaceGroupInfo - look up information about space groups
    
    properties (SetAccess=immutable)
        number
        name
        formattedName
        pointGroupNumber
        laueGroupNumber
        generators
        generalPositions
    end
    
    properties(Dependent = true) % note: would be better to put these in the data table, so they are searchable
        centeringType
        crystalSystem
        latticeSystem
        latticeName
        testLattice
        isPointGroup
        isLaueGroup
    end
    
    methods
        function obj = SpaceGroupInfo(varargin)
            switch nargin
                case 1
                    if isnumeric(varargin{1})
                        sgnum = varargin{1};
                    else
                        sgnum = symm.SpaceGroupInfo.search('name',varargin{1});
                    end
                case 2
                    sgnum = symm.SpaceGroupInfo.search(varargin{:});
                otherwise
                    error('number of inputs should be 1 or 2');
            end
            
            if numel(sgnum) > 1
                for j=1:numel(sgnum)
                    obj(j) = symm.SpaceGroupInfo(sgnum(j));
                end
            elseif numel(sgnum) == 0
                obj = symm.SpaceGroupInfo.empty();
            else
                assert(numel(sgnum) == 1 && sgnum == floor(sgnum),...
                    'index should be an integer');
                assert(sgnum > 0 && sgnum <= 230,...
                    'index out of range');
                obj.number = sgnum;
                sgdata = sg_data_table();
                thisData = sgdata{sgnum};
                
                obj.name = thisData{2};
                obj.formattedName = thisData{3};
                obj.pointGroupNumber = thisData{4};
                obj.laueGroupNumber = thisData{5};
                obj.generators = thisData{6};
                obj.generalPositions = thisData{7};
            end
        end
        
        function val = get.centeringType(obj)
            firstLetter = obj.name(1); % first letter of the name is the centering type, unless it's R
            switch firstLetter
                case 'R'
                    val = 'P';
                otherwise
                    val = firstLetter;
            end
        end
        function val = get.latticeName(obj)
            % Bravais lattice name
            latt = obj.latticeSystem;
            cen = obj.centeringType;
            switch cen
                case 'P'
                    val = 'Primitive';
                case {'A','B','C'}
                    val = 'Base-centered';
                case 'I'
                    val = 'Body-centered';
                case 'F'
                    val = 'Face-centered';
            end
            val = [val ' ' latt];
            
        end
        function val = get.crystalSystem(obj)
            sgnum = obj.number;
            if sgnum <= 2
                val = 'Triclinic';
            elseif sgnum <= 15
                val = 'Monoclinic';
            elseif sgnum <= 74
                val = 'Orthorhombic';
            elseif sgnum <= 142
                val = 'Tetragonal';
            elseif sgnum <= 167
                val = 'Trigonal';
            elseif sgnum <= 194
                val = 'Hexagonal';
            elseif sgnum <= 230
                val = 'Cubic';
            end
        end
        function val = get.latticeSystem(obj)
            cSys = obj.crystalSystem;
            switch cSys
                case 'Trigonal'
                    switch upper(obj.name(1)) % should always be uppercase, but just in case
                        case 'R'
                            val = 'Rhombohedral';
                        otherwise
                            val = 'Hexagonal';
                    end
                otherwise
                    val = cSys;
            end
        end
        function isLattice = get.testLattice(obj)
            % testLattice return function handle that checks whether lattice
            % properties are consistent with the crystal system
            %
            % see table 6-6 on page 300 in Rupp book
            switch lower(obj.crystalSystem)
                case 'triclinic'
                    % nothing to check
                    isLattice = @(a,b,c,alpha,beta,gamma) true;
                case 'monoclinic'
                    isLattice = @(a,b,c,alpha,beta,gamma) alpha==90 & gamma==90;
                case 'orthorhombic'
                    isLattice = @(a,b,c,alpha,beta,gamma) alpha==90 & beta==90 & gamma==90;
                case 'tetragonal'
                    isLattice = @(a,b,c,alpha,beta,gamma) a==b & alpha==90 & beta==90 & gamma==90;
                case {'trigonal','hexagonal'}
                    isLattice = @(a,b,c,alpha,beta,gamma) a==b & alpha==90 & beta==90 & gamma==120;
                case 'cubic'
                    isLattice = @(a,b,c,alpha,beta,gamma) a==b & b==c & alpha==90 & beta==90 & gamma==90;
                otherwise
                    error('this really shouldn''t happen');
            end
        end
        function tf = get.isPointGroup(obj)
            % isPointGroup Check whether space group number corresponds to one
            % of the Point groups.
            %
            % The following script will generate the point group list
            %
            %   t = SpaceGroupInfo.table();
            %   fprintf(1,'\n pgnums = [');
            %   fprintf(1,'%d,',unique(t.pointGroupNumber)');
            %   fprintf(1,'\b];\n');
            pgnums = [1,2,3,6,10,16,25,47,75,81,83,89,99,111,115,123,143,...
                147,149,150,156,157,162,164,168,174,175,177,183,187,189,...
                191,195,200,207,215,221];
            
            tf = ismember(obj.number,pgnums);
        end
        function tf = get.isLaueGroup(obj)
            % isLaueGroup Check whether space group number corresponds to one
            % of the Laue groups.
            %
            % The following script will generate the laue group list
            %
            %     t = SpaceGroupInfo.table();
            %     fprintf(1,'\n lgnums = [');
            %     fprintf(1,'%d,',unique(t.laueGroupNumber)');
            %     fprintf(1,'\b];\n');
            
            lgnums = [2,10,47,83,123,147,162,164,175,191,200,221];
            tf = ismember(obj.number,lgnums);
        end
    end
    
    methods(Static)
        function sgnums = search(colName,matchVal)
            % SEARCH numeric or char fields (case insensitive)
            sgtable = symm.SpaceGroupInfo.table();
            if ischar(matchVal)
                sgnums = find(strcmpi(sgtable.(colName),matchVal));
            elseif isnumeric(matchVal)
                sgnums = find(sgtable.(colName)==matchVal);
            else
                error('input type not recognized');
            end
        end
        
        function sgtable = table()
            sgdata = sg_data_table();
            colNames = {'number','name','formattedName','pointGroupNumber','laueGroupNumber','generators','generalPositions'};
            sgtable = cell2table(reshape([sgdata{:}],7,230)',...
                'VariableNames',colNames);
        end
    end
end

